var icono_upload_file = 'data:image/jpeg;base64,';
var icono_pdf2_b64 = 'data:image/png;base64,';

//EVENTO PARA ABRIR LA VENTANA MODAL
$('#btnAsignar').click(function () {
    limpiarForm();
    $('#modalAsignar').modal('show');
});


$(document).ready(function () {
    //SCRIPT PARA PREVISUALIZAR LA IMAGEN O PDF CARGADO
    $("#imgPreview").attr("src", icono_upload_file);
    $("#imgFile").change(function () {
        const file = this.files[0];
        var fileName = this.files[0].name;
        if (file) {
            let reader = new FileReader();
            reader.onload = function (event) {
                var ext = fileName.split('.').pop();
                if (ext == "pdf") {
                    $("#imgPreview")
                        .attr("src", icono_pdf2_b64);
                } else {
                    $("#imgPreview").attr("src", event.target.result);
                }
            };
            reader.readAsDataURL(file);
        }
    });

    //SCRIPT PARA APLICAR EL FUNCIONAMIENTO DE DATE PICKER A LOS IMPUTS DE LOS FILTROS FECHA
    var fecha = new Date();
    var strFecha = fecha.getDate() + "/" + (fecha.getMonth() + 1) + "/" + fecha.getFullYear();
    $('.date_fecha').val(strFecha);

    var date_input = $('input[name="date_fecha"]'); //our date input has the name "date"
    var container = $('.bootstrap-iso form').length > 0 ? $('.bootstrap-iso form').parent() : "body";
    var options = {
        format: 'dd/mm/yyyy',
        container: container,
        todayHighlight: true,
        autoclose: true
    };
    date_input.datepicker(options);

    //CARGAMOS LA LISTA DE CAJA CHICAS ASIGNADAS
    CajaAsignacionListar();

    //FUNCION PARA VALIDAR INGRESO DE DATOS NUMERICOS
    $('.validanumeros').keypress(function (e) {
        if (isNaN(this.value + String.fromCharCode(e.charCode)))
            return false;
    }).on("cut copy paste", function (e) {
        e.preventDefault();
    });
});

//FUNCION PARA CONVERTIR LOS DATOS DATOS INGRESADOS A MAYUSCULAS
function mayus(e) {
    e.value = e.value.toUpperCase();
}